  .ff-container .ff-image {
    z-index: 0;
    vertical-align: top;
    background: rgba(0, 0, 0, 0.5);
    opacity: 0; }
    .ff-container .ff-image.ff-image-ready {
      opacity: 1; }
  .ff-container .ff-canvas {
    display: inline-block;
    position: absolute;
    top: 0;
    left: 0;
    pointer-events: none;
    z-index: 1;
    vertical-align: top;
    opacity: 0; }
    .ff-container .ff-canvas.ff-responsive {
      width: 100%; }
    .ff-container .ff-canvas.ff-canvas-ready {
      transition: opacity 300ms;
      opacity: 1; }
    .ff-container .ff-canvas.ff-canvas-active {
      transition: none;
      opacity: 0; }
  .ff-container.ff-responsive {
    width: 100%; }
    .ff-container.ff-responsive .ff-image {
      width: 100%; }
    .ff-container.ff-responsive .ff-canvas-ready {
width: 100%; }

    #escaped { display:none; }

    #room { display:none; }
    #room #explanation { margin-top: 15px; margin-bottom: 15px; color:#555555; font-size:0.95em;}
    #room #status { margin-top: 15px; }
    #room #door, #room #door_moving { margin-right: auto; margin-left: auto; width:370px; display: block; }
    #room input[type='text'] { width:350px; }
    #room input[type='submit'] { width:140px; }

    #install label { display: block; margin-bottom: 15px; }

    function key(value) {
      return "-----------------"+value.toLowerCase()+"-&;y";
    }
    function hash(value) {
      return SHA256(key(value));
    }
    function create(form) {
      var explanation = form["explanation"].value;
      var opened = form["opened"].value;
      var key_ = key(form["key"].value);
      var hash_ = hash(form["key"].value);
      var opened_crypt = CryptoJS.AES.encrypt(opened, key_).toString();
      setData({explanation:explanation, hash:hash_, tries:0, opened_crypt:opened_crypt});
      console.log(getData());
      form["key"].value = ""
      form["explanation"].value = ""
      form["opened"].value = ""
      refreshScreen();
      return false;
    }
    var door;
    var escaped;
    function getData() {
        return JSON.parse(document.cookie.substr(5));
    }
    function unsetData() {
        document.cookie = "data=; expires=Thu, 01 Jan 1970 00:00:00 UTC";
    }
    function setData(data) {
      document.cookie = "data="+JSON.stringify(data)+"; expires=Thu, 01 Jan 2020 00:00:00 UTC";
    }
    function refreshScreen() {
      if (escaped) {
        document.getElementById("install").style.display = "none";
        document.getElementById("room").style.display = "none";
        document.getElementById("escaped").style.display = "block";
      } else if (document.cookie != "") {
        var data = getData();
        document.getElementById("install").style.display = "none";
        document.getElementById("room").style.display = "block";
        document.getElementById("explanation").innerText = data["explanation"];
        document.forms["room"].answer.value = "";
        document.getElementById("door_moving").style.display = "none";
        document.getElementById("door").style.display = "block";
        //door = new freezeframe('#door');
        //door.capture();
        //door.setup();
        //door.release();
        document.forms["room"].answer.disabled = false;
        document.forms["room"].button.disabled = false;
        if (data["tries"] == 0) {
          document.getElementById("status").innerHTML = "";
        } else if (data["tries"] < 3) {
          document.getElementById("status").innerHTML = "Antwoord is verkeerd! Probeer opnieuw.";
        } else {
          document.getElementById("status").innerHTML = "Antwoord is verkeerd! <br/> U moet 5min wachten vooraleer opnieuw te proberen.";
          document.forms["room"].answer.disabled = true;
          document.forms["room"].button.disabled = true;
          window.setTimeout(function() {
            document.forms["room"].answer.disabled = true;
            document.forms["room"].button.disabled = true;
            data["tries"] = 0
            setData(data);
            refreshScreen();
          }, 5*60*1000);
        }
      } else {
        document.getElementById("install").style.display = "block";
        document.getElementById("room").style.display = "none";
      }
    }

    function check(form) {
      document.getElementById("door_moving").style.display = "block";
      document.getElementById("door").style.display = "none";
      form["answer"].disabled = true;
      form["button"].disabled = true;
      document.getElementById("status").innerHTML = "Bezig met controleren ...";
      window.setTimeout(function() {
        document.getElementById("door_moving").style.display = "none";
        document.getElementById("door").style.display = "block";
        form["answer"].disabled = false;
        form["button"].disabled = false;
        var data = getData();
        if (hash(form["answer"].value) == data["hash"]) {
          escaped = true;

          var decrypted = CryptoJS.AES.decrypt(data["opened_crypt"], key(form["answer"].value)); 
          document.getElementById("success").innerHTML = decrypted.toString(CryptoJS.enc.Utf8);
          document.getElementById("room").style.display = "none";
          document.getElementById("escaped").style.display = "block";
          document.getElementById("status").innerHTML = "";

          document.forms["setup"].key.value = form["answer"].value
          document.forms["setup"].explanation.value = data["explanation"]
          document.forms["setup"].opened.value = decrypted.toString(CryptoJS.enc.Utf8);

          unsetData();
        } else {
          data["tries"] += 1
          setData(data);
          refreshScreen();
        }
      }, 2000);
      return false;
    }
  </script>
</head>
